INSERT INTO `modules` (`id`, `module_name`, `module_type`, `thumbnail`, `status`, `stores_count`, `created_at`, `updated_at`, `icon`, `theme_id`, `description`, `all_zone_service`) VALUES
(1, 'Grocery', 'grocery', '2024-04-20-662398cb7f5ef.png', 1, 2, '2023-08-15 23:31:17', '2024-07-11 19:46:23', '2024-04-20-662398cb7f2e7.png', 1, '<p><strong>We make grocery shopping more interesting.</strong><br />\r\nFind the greatest deals from the grocery stores near you.<br />\r\n<br />\r\n<strong>Nature &amp; Organic Products</strong><br />\r\nBring Nature into your home.<br />\r\n<br />\r\n<strong>Stay home &amp; get your daily needs from our shop</strong><br />\r\nStart You&#39;r Daily Shopping with &quot;Business name&quot;</p>', 0),
(2, 'Food', 'food', '2024-07-11-668fa63b1db9c.png', 1, 2, '2024-07-11 04:30:35', '2024-07-11 19:42:58', '2024-07-11-668fa63b1d6c4.png', 1, '<p> <strong>Your Food Business</strong>: Delight in every bite with our vibrant and innovative food business, serving up fresh, flavorful, and diverse dishes. We blend tradition and creativity to offer an unforgettable culinary experience, ensuring every meal is a feast for the senses! </p>', 0),
(3, 'Pharmacy', 'pharmacy', '2024-07-11-668fa76131737.png', 1, 2, '2024-07-11 04:35:29', '2024-10-11 01:11:17', '2024-07-11-668fa761312d3.png', 1, '<p>Our pharmacy business offers a wide range of prescription and over-the-counter medications, health products, and wellness advice. We prioritize customer health and convenience with a friendly, knowledgeable staff and quick service. </p>', 0),
(4, 'Ecommerce', 'ecommerce', '2024-07-11-668fa816e55be.png', 1, 2, '2024-07-11 04:38:30', '2024-10-11 01:32:45', '2024-07-11-668fa816e516b.png', 1, '<p>We run a dynamic e-commerce pharmacy, offering a wide range of medications and healthcare products online.  Convenient, reliable, and fast delivery ensures you get what you need right at your doorstep.  Your health and wellness are our top priorities. </p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0),
(5, 'Parcel', 'parcel', '2024-07-11-668fa8a527b57.png', 1, 0, '2024-07-11 04:40:53', '2024-07-11 04:40:53', '2024-07-11-668fa8a52774a.png', 1, '<p>Our parcel business offers reliable and swift delivery services , ensuring packages reach their destinations safely and on time . We prioritize customer satisfaction and handle each parcel with care . Trust us for your shipping needs! </p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0);

